import * as React from 'react';
import { styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Collapse from '@mui/material/Collapse';
import Avatar from '@mui/material/Avatar';
import IconButton, { IconButtonProps } from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import { red } from '@mui/material/colors';
import Grid from  '@mui/material/Grid';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';




export default function TeachersDashboard() {
  const [expanded, setExpanded] = React.useState(false);

return (

    <React.Fragment>
    <CssBaseline />
    <Container maxWidth="sm">
      <Box sx={{ height: '100vh' }} >
    <Grid>     
    <Card sx={{ maxWidth: "400px",mx:"50px" }}>
      <CardHeader
        // avatar={
        //   <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
        //     R
        //   </Avatar>
        // }
        action={
          <IconButton aria-label="settings">

          </IconButton>
        }
        title="TeachersDashboard"
        // subheader="September 14, 2016"
      />
      <CardMedia
        component="img"
        height="194"
        // image="https://png.pngtree.com/png-clipart/20200224/original/pngtree-avatar-icon-profile-icon-member-login-vector-isolated-png-image_5247852.jpg"
        image="data:image/png;base64,"
        alt="Paella dish"
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {/* This impressive paella is a perfect party dish and a fun meal to cook
          together with your guests. Add 1 cup of frozen peas along with the mussels,
          if you like. */}
          TeachersDashboard
        </Typography>
      </CardContent>
      <CardActions disableSpacing>
        <IconButton aria-label="add to favorites">
     
        </IconButton>
        <IconButton aria-label="share">
   
        </IconButton>
    
      </CardActions>
     
    </Card>
    </Grid>


    <Button variant="contained" sx={{my:"30px",mx:"10px"}} >Create Class</Button>
    <Button variant="contained" sx={{my:"30px",mx:"10px"}} >Add Student</Button>

    <Typography sx={{mt:"30px"}} variant="h3" gutterBottom component="div">
        Class Details
    </Typography>
    <Grid>
    <TextField  sx={{mt:"30px"}}
                  autoComplete="given-name"
                  name="subjectName"
                  required
                  fullWidth
                  id="subjectName"
                  label="subjectName"
                  autoFocus
                  />
    </Grid>
    <Grid>
    <TextField  sx={{mt:"30px"}}
                  autoComplete="given-name"
                  name="Document"
                  required
                  fullWidth
                  id="Document"
                  label="Documment"
                  autoFocus
                  />
    </Grid>
    <Button variant="outlined" sx={{my:"30px",mx:"180px"}} >Create Class</Button>

    <Typography sx={{mt:"30px"}} variant="h3" gutterBottom component="div">
        Class Details
    </Typography>
    <Grid>
    <TextField  sx={{mt:"30px"}}
                  autoComplete="given-name"
                  name="subjectName"
                  required
                  fullWidth
                  id="subjectName"
                  label="subjectName"
                  autoFocus
                  />
    </Grid>
    <Grid>
    <TextField  sx={{mt:"30px"}}
                  autoComplete="given-name"
                  name="Document"
                  required
                  fullWidth
                  id="Document"
                  label="Documment"
                  autoFocus
                  />
    </Grid>
    <Button variant="outlined" sx={{my:"30px",mx:"180px"}} >Create Class</Button>
    </Box>
    </Container>
  </React.Fragment>

  );
}
